import React from 'react';
import ReactDOM from 'react-dom';  // Necesitas importar ReactDOM para renderizar en el DOM
import './styles/styles.css';  // Asumiendo que tienes un archivo de estilos CSS

import App from './components/App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router } from 'react-router-dom';  // Cambié de @react-navigation/native a react-router-dom

const root = document.getElementById('root');

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <App />
    </Router>
  </React.StrictMode>,
  root
);

// Reporte de métricas de rendimiento
reportWebVitals();
